title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o8719.m26 -> o8715.m12 -> o8719.m26
  o8719.m10 -> o8715.m37 -> o8719.m2 -> o8715.m12 -> o8719.m26 -> o8715.m12
  o8715.m37 -> o8719.m2 -> o8715.m12 -> o8719.m26 -> o8715.m12
  o8719.m2 -> o8715.m12 -> o8719.m26 -> o8715.m12
  o8715.m35 -> o8715.m37 -> o8719.m2 -> o8715.m12 -> o8719.m26 -> o8715.m12
  o8715.m12 -> o8719.m26 -> o8715.m12

features:
  - inheritance
  - overriding
  - method
  - polymorphism

